import styled from 'styled-components';
import React from 'react';
import Navbar from './navbar';





const Wrapper = styled.div
`   display: flex;
    flex-flow: column;
    align-items: center;
    justify-content: center;
    height: 100%;
`;
const Logo = styled.img
`
border-radius: 10%;
max-width: 80%;
max-height: 80%;
`;
const Styleddiv = styled.div`

  display: flex;
  align-items: center;
  flex-flow: column;
  height: 10%;
  width: 80%;
  padding: 20px;
  padding-bottom : 40px;
  margin-bottom: 8% auto;
  margin-top: 13% auto;
  border: 1px solid #fffff;
  border-radius: 9px;
  background: #f7f7f7;
  h2 {
    font-family: Arial, Helvetica, sans-serif;
    font-size: 14px;
  }
  button {
    background: #ff8019;
    color: #fff;
    padding: 11px;
    margin-top: 15px;
    width: 80%;
    border: none;
    border-radius: 4px;
    box-sizing: border-box;
  }
`;




class Forestpage extends React.Component{

    componentDidMount()
    {
        document.body.style.backgroundColor = "#dbdbdb";
    }
    render(){
        return(
            <Wrapper>
               <Nav/>
                <Styleddiv>
                    nav
                </Styleddiv>
            </Wrapper>
        );
    }
}
export default Forestpage;
